import './App.css';
import User from './getuser/User';
import {createBrowserRouter} from "react-router-dom";

function App() {
  const route = createBrowserRouter([
    {
      path:"/",
      element: <User />
    }
  ]);
  return (
    <div className="App">
      <RouterProvide router={route}></RouterProvide>
    </div>
  );
}

export default App;
